class Solution:
    def strStr(self, haystack: str, needle: str) -> int:
        if len(needle) == 0:
            return 0

        # keep track of potential start indexes, while we traverse the list
        potentials = {}
        for index in range(len(haystack)):
            # if this matches the start of the needle, then it's potentially a match!
            if (
                len(haystack) >= len(needle) + index
                and haystack[index] == needle[0]
                and haystack[index + (len(needle) - 1)] == needle[-1]
            ):
                potentials[index] = 0

            # iterate through the potentially valid positions, and remove those that
            # no longer are valid
            deletion_queue = set()
            for potential_index, needle_index in potentials.items():
                # invalid if character does not match, or needle no longer fits
                if haystack[index] != needle[needle_index]:
                    deletion_queue.add(potential_index)
                    continue
                needle_index += 1
                # return the position if it has been checked across the whole string
                if needle_index >= len(needle):
                    return potential_index
                potentials[potential_index] = needle_index
            while len(deletion_queue) > 0:
                del potentials[deletion_queue.pop()]

        return -1


examples = [
    (("hello", "ll"), 2),
    (("aaaaa", "bba"), -1),
    (("", ""), 0),
    (("test", "t"), 0),
    (("test", "e"), 1),
    (("", "e"), -1),
    (
        (
            "",
            "",
        ),
        -1,
    ),
    (
        (
            "",
            "",
        ),
        39999,
    ),
]
